export default function ControlLabel(theme: any): {
    MuiFormControlLabel: {
        styleOverrides: {
            label: any;
        };
    };
    MuiFormHelperText: {
        styleOverrides: {
            root: {
                marginTop: any;
            };
        };
    };
    MuiFormLabel: {
        styleOverrides: {
            root: {
                color: any;
            };
        };
    };
};
